import React, { useEffect, useState } from "react";
import { Container, styleTableContainer, styleButton } from '../style.js';
import { Table, TableHead, TableFooter, TableContainer, TableBody, Paper, TableRow, TableCell, TablePagination, Button } from '@mui/material';
import { Link, useNavigate } from  "react-router-dom";
import {useSelector} from "react-redux"
import axios from 'axios';


const RankPage = (props) => {
  const [rankData, setRankData] = useState([]); 

  useEffect(() => {
    axios.get('/api/game/topRank',{
      // headers: {
      //   "Content-Type": "application/json",
      //   "Authorization": `Bearer ${token}`
      // }
    })
    .then(response => {
      console.log(response);
      setRankData(response.data);
    });
  }, []);


  const [page, setPage] = useState(0);
  const [rowsPerPage, setRowsPerPage] = useState(10);
  const navigate = useNavigate();

  const handleChangePage = (event, newPage) => {
    setPage(newPage);
  }

  const handleChangeRowsPerPage = (event) => {
    setRowsPerPage(parseInt(event.target.value, 10));
    setPage(0);
  }
  
  // const navigate = useNavigate();

  // const goNoticeDetail = (id) => {
  //   navigate("/"+id)
  // };
  // const { onChangePage, onChangeRowsPerPage } = props;
  // constonChangeRowsPerPage.bind(props);

  return (
    <Container>
      <h2 style={{color:"#dcdcdc", fontSize:'3rem'}}>RANK</h2>
      {/* <span style={{marginBottom:20}}>
        <label style={{color:"#dcdcdc", fontSize:'1.5em'}} align="right" htmlFor="search">검색</label>
        <input id="search" type={'text'}
        value={keyword} align="right"
        onChange={(e) => {
            setKeyword(e.target.value);
        }}
        ></input>
        <button style={styleButton} align="right"
        onClick={searchKeyword}>검색</button>
      </span> */}
      {/* <p>{noticeData}</p> */}
      <TableContainer style={styleTableContainer} component={Paper}>
        <Table size="medium">
          <TableHead>
            <TableRow>
              <TableCell sx={{fontWeight:'bold'}}>순 위</TableCell>
              <TableCell sx={{fontWeight:'bold'}} align="center">아이디</TableCell>
              <TableCell sx={{fontWeight:'bold'}} align="center">승리</TableCell>
              <TableCell sx={{fontWeight:'bold'}} align="center">패배</TableCell>
              <TableCell sx={{fontWeight:'bold'}} align="center">점수</TableCell>
            </TableRow>
          </TableHead>
            <TableBody>
              {rankData
                .slice(page * rowsPerPage, (page + 1) * rowsPerPage)
                .map((data, idx) => (
                  <TableRow key={idx}>
                    <TableCell component="th" scope="row">
                      {idx+1}
                    </TableCell>
                    <TableCell align="center">{data[0]}</TableCell>
                    <TableCell align="right">{data[1]}</TableCell>
                    <TableCell align="right">{data[2]}</TableCell>
                    <TableCell align="right">{data[3]}</TableCell>
                  </TableRow>
                ))}
          </TableBody>
          <TableFooter>
            <TableRow>
              <TablePagination
                page={page}
                count={rankData.length}
                rowsPerPage={rowsPerPage}
                onPageChange={handleChangePage}
                onRowsPerPageChange={handleChangeRowsPerPage}
              />
            </TableRow>
          </TableFooter>
        </Table>
      </TableContainer>
    </Container>
  );
};

export default RankPage;
